import React, { useState } from "react";
import { BrowserRouter as Router, Switch, Route, useHistory } from "react-router-dom";
import "./Table5.css";
import Range1 from "./Range1";
import Range2 from "./Range2";
import Range3 from "./Range3";
import Range4 from "./Range4";
import Range5 from "./Range5";
import Range6 from "./Range6";

const Table5 = () => {
  const [selectedRange, setSelectedRange] = useState("");
  const history = useHistory();
  const [display, setDisplay] = useState(true);

  const handleBack = () => {
    history.goBack();
    setDisplay(true);
  };

  const handleRangeSelection = (range) => {
    setSelectedRange(range);
    setDisplay(false);
  };

  return (
    <>
      <br />
      <Router>
        <nav className="header-container">
          <div className="header-content">
            <div className="back-container">
              <button className="btn btn-secondary" onClick={handleBack}>
                Back
              </button>
            </div>
            <div className="dropdown-container">
              <div className="dropdown">
                <button
                  className="nav-link btn btn-link dropdown-toggle"
                  id="navbarDropdown"
                  data-toggle="dropdown"
                  aria-haspopup="true"
                  aria-expanded={selectedRange ? true : false}
                >
                  {selectedRange ? selectedRange : "Dropdown"}
                </button>
                <div className={`dropdown-menu dropdown-menu-right ${selectedRange ? "show" : ""}`}>
                  <button className="dropdown-item" onClick={() => handleRangeSelection("1-100")}>
                    1-100
                  </button>
                  <button className="dropdown-item" onClick={() => handleRangeSelection("100-1000")}>
                    100-1000
                  </button>
                  <button className="dropdown-item" onClick={() => handleRangeSelection("1000-10000")}>
                    1000-10000
                  </button>
                  <button className="dropdown-item" onClick={() => handleRangeSelection("10000-50000")}>
                    10000-50000
                  </button>
                  <button className="dropdown-item" onClick={() => handleRangeSelection("50000-100000")}>
                    50000-100000
                  </button>
                  <button className="dropdown-item" onClick={() => handleRangeSelection("100000 and above")}>
                    100000 and above
                  </button>
                </div>
              </div>
            </div>
          </div>
        </nav>
        {display ? (
          <Range1 />
        ) : (
          <div></div>
        )}
        <div>
          <Switch>
            <Route path="/range1">
              <Range1 />
            </Route>
            <Route path="/range2">
              <Range2 />
            </Route>
            <Route path="/range3">
              <Range3 />
            </Route>
            <Route path="/range4">
              <Range4 />
            </Route>
            <Route path="/range5">
              <Range5 />
            </Route>
            <Route path="/range6">
              <Range6 />
            </Route>
          </Switch>
        </div>
      </Router>
    </>
  );
};

export default Table5;
